import React from "react";

export default function MostPicked(props) {
  return (
    <section className="px-36">
      <h4 className="text-2xl mb-5">Most Picked</h4>
      <div className="grid grid-rows-2 grid-flow-col gap-7">
        {props.data?.map((item, index) => {
          return (
            <div
              className={
                index === 0
                  ? `bg-red-400 min-h-[215px] row-span-2`
                  : `bg-red-400 min-h-[215px]`
              }
            >
              <figure className="rounded-2xl">
                <img src={item?.imageUrl} alt={item?.name} className="" />
              </figure>
            </div>
          );
        })}
      </div>
    </section>
  );
}
